import React from 'react';
import {View, Text, Button} from 'react-native'

export default function Profile(props) {
  return (
    <View>
      <Text>Hi, {props.route.params.username} </Text>
      <Button title="Go to Profile" onPress= {() => props.navigation.navigate("Home", {
        icon: "",
        username: username,
        astroSign: ""
      })}> </Button>
    </View>
  )
}
